type ScriptId = string;
export type CreateScript = (src: string) => Promise<ScriptId | any>;

export const createScript = (src) => {
  return new Promise((resolve, reject) => {
    if(document.getElementById(`async_script${src}`)) {
      return reject();
    }
    const script: HTMLScriptElement = document.createElement('script');
    script.id = `async_script_${src}`;
    script.src = src;
    script.addEventListener('load', () => resolve(script.id));
    script.addEventListener('error', (response) => reject(response));

    document.body.appendChild(script);
  })
}

import * as React from 'react';
import {INaverLoginProperties} from '../@types/naverLogin';
import {NAVER_SCRIPT_SRC} from '../lib/constants';
import { createScript } from '../lib/createScript';

declare global {
  interface Window {
    naver: any
  }
}
 
type TNaverLogin = any;

interface IUserNaverLoginResult {
  loading: boolean;
  naverLoginInit: () =>TNaverLogin
}

type TUserNaverLogin = (parameter: INaverLoginProperties) => null | IUserNaverLoginResult;

const useNaverLogin:TUserNaverLogin = ({
  clientId,
  callbackUrl,
  isPopup,
  loginButton = {color: "green", type: 2, height: 42},
  callbackHandle = true
}) => {
  if(!('browser' in process)) {
    return null;
  }
  const [isLoadedScript, setIsLoadedScript] = React.useState<boolean>(window?.naver?.LoginWithNaverId ? true : false);

  const naverLoginInit = React.useCallback(() => {
    if(isLoadedScript) {
      const naverLogin = new window.naver.LoginWithNaverId(
        {
          clientId,
          callbackUrl,
          isPopup,
          loginButton,
          callbackHandle
        }
      );

      naverLogin.init();
      return naverLogin;
    }
    
    return null;
  }, [isLoadedScript]);

  React.useEffect(() => {
    if(!isLoadedScript) {
      createScript(NAVER_SCRIPT_SRC)
        .then(() => {
          setIsLoadedScript(true);  
        })
    }
  }, [isLoadedScript]);
  
  return {
    loading: !isLoadedScript,
    naverLoginInit,
  }
};

export default useNaverLogin;

import * as React from 'react';
import {INaverLoginProperties} from '../@types/naverLogin';
import useNaverLogin from '../hooks/useNaverLogin';
import './default.css';

const NaverLogin: React.FC<INaverLoginProperties> = ({
  clientId,
  callbackUrl,
  loginButton = {color: "green", type: 2, height: 42},
  isPopup,
  callbackHandle = true,
  children
}) => {
  if(!('browser' in process)) {
    return null;
  }
  const buttonRef = React.useRef<HTMLDivElement>(null);
  const {naverLoginInit, loading} = useNaverLogin({
    clientId,
    callbackUrl,
    loginButton,
    isPopup,
    callbackHandle
  }) || {};
  

  React.useEffect(() => {
    if(!loading && buttonRef.current) {
      naverLoginInit && naverLoginInit();
    }
  }, [loading, buttonRef]);
  
  return (
    <>
      {children && (
        <>
          <div
            onClick={() => {
              const {current} = buttonRef;
              if(current !== null) {
                const a = current.querySelector('a');
                if(a) a.click();
              }
            }}
          >
            {children}
          </div>
        </>  
      )}
      <div className={children ? 'hide' : ''}>
        <div 
          id="naverIdLogin"
          ref={buttonRef}
        />
      </div>
    </>
  )
};

NaverLogin.displayName = 'NaverLogin';
export default React.memo(NaverLogin);
